    for c in it:
        lst.append(chr(int(''.join(
                     (c, next(it), next(it)) if c=='1' else (c, next(it))
                   ))))
    return ''.join(lst)

def decipher(cipher):
    s = ''
    while cipher != '':
        if int(cipher[:3]) <= 122:
            s +=  chr(int(cipher[:3]))
            cipher = cipher[3:]
        else:
            s += chr(int(cipher[:2]))
            cipher = cipher[2:]
    return s

def decipher(cipher):
    temp,aus = "",""
    for dig in cipher:
        temp = temp + dig
        if int(temp) >= 97 and int(temp) <= 122:
            aus += chr(int(temp))
            temp = ""
    return aus

from re import findall
def decipher(cipher):
